import React from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import styled from "styled-components";

const WarmingUpPage = () => {
  const navigate = useNavigate();
  return (
    <Wrap>
      <HowBox>
        <h2>게임 설명</h2>
        <br />
        <p>
          산리오 캐릭터 키링을 뽑고 싶은 자...
          <br />
          빼빼로를 만들라...
          <br />
          <br />
          <br />
          3단계의 게임을 거쳐 성공한다면 빼빼로 1개가 완성되고,
          <br />
          총 6개의 빼빼로를 모으면 키링 뽑기 1회를 할 수 있게 된다.
          <br />
        </p>
        <Link to="step1">
          <Btn>ㅇㅋ 빼빼로 만들고 키링 뽑으러 ㄱㄱ</Btn>
        </Link>
   
      </HowBox>
    </Wrap>
  );
};

const Wrap = styled.div`
  width: 60%;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`;

const HowBox = styled.div`
  width: 50%;
  height: 500px;
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: red;
`;

const Btn = styled.button`
  width: 80px;
  height: 30px;
  border-radius: 5px;
  border: 2px solid orange;
  display: flex;
  align-items: center;
  justify-content: center;
  /* margin-top: 50%; */
  font-size: 0.5rem;
  &:first-child {
    margin-right: 5%;
  }
`;

export default WarmingUpPage;
